import React from 'react'
import styled from 'styled-components'
import { Header } from '../main-pages/header'
import { Margin36 } from '../component/styledComponent'
import { TermBox } from './termBox'
import { LocationText } from './text'
import { Footer } from '../main-pages/footer'

const Container = styled.div`
  width: 100%;
`
const BodyContainer = styled.div`
  margin: 0 auto;
  width: 1280px;
`

const Title = styled.div`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 24px;
  line-height: 24px;
  color: #000000;
  text-align: left;
  margin-top: 56px;
`

export const Location = () => {
  return (
    <Container>
      <Header />
      <BodyContainer>
        <Title>위치기반 이용약관</Title>
      </BodyContainer>
      <Margin36 />
      <BodyContainer>
        {LocationText.map(location => {
          return <TermBox title={location.title} contents={location.contents} />
        })}
        <div style={{ marginTop: '80px' }} />
      </BodyContainer>
      <Footer />
    </Container>
  )
}
